import React from 'react';
import LargeDivider from './LargeDivider';

class Footer extends React.Component {
	render() {
		return (
			<footer className="container">
				<div className="row">
					<div className="ml-lg-5 col-lg-12">
						<LargeDivider/>
					</div>
				</div>
				<div className="row ml-lg-5">
					<div className="ml-lg-5 col-lg-12">
					<p className="col-lg-4">Documentation</p>
					<p className="col-lg-4 offset-lg-4">Copyrights</p>
					<p className="col-lg-4" >Contact</p>
					</div>
				</div>
			</footer>
		)
	}
}

export default Footer;
